import React, { Component } from "react";

// reactstrap components
import { Button } from "reactstrap";

class NotFound extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="fixed-plugin">
        <h1>Página não encontrada</h1>
      </div>
    );
  }
}

export default NotFound;
